import React, { Component } from "react";
import Navbar from '../navbar/navbar'
import './adminHomePage.css'
class adminHomePage extends Component{
    constructor(){
        super();
            this.state = {
                adminData: "",
            }
         }

    render(){
        return(
            <div>
              <div>
                <Navbar/>
                </div>  
           
            <div>
                Admin Home page
            </div>
            </div> 
        )
    }

}
export default adminHomePage;
